【サイズ】約幅17.5×奥行12.5×高さ20cm<br>
【容量】約1.1L<br>
【材質】<br>
ホーロー用鋼板(表面加工:ほうろう)<br>
こしアミ枠部・アミ部:ステンレス鋼 <br>
こしアミ付き <br>
食洗機使用不可<br>
乾燥機使用不可 <br>
中国製<br><br>

清潔感ある白の本体、内面も白いので油の色がよくわかる!ホーローキャニスターです。<br>
ステンレス製のオイルフィルターが付属されており、取り外して洗えいつも清潔にお使いいただけます。 <br>
ホーロー製ですので 酸・アルカリに強く 腐食しにくいので長持ち。<br>
ホーローの表面はガラス質だから洗いやすいです。<br><br>

※ホーローの表面はガラス質です。落としたり強い衝撃を与えると割れる場合があります。ご注意下さいませ。<br><br>

【ご確認事項】<br>
※一つ一つ手作りです。厚み・重さ・サイズ・色に差が出る事がございます。  <br>
※フチ部分や持ち手部分は特に釉薬がかかりづらい為ハゲがある場合がございます。<br>
※色抜け・白飛び・色ムラがございます。<br>
※加工段階での多少の磨きキズや凹み・折り曲げ加工の微細なズレ・歪み・汚れがある場合もございます。<br>
メーカーより“良品”として販売されております。ハンドメイド製品をご理解いただきご注文をお願い致します。<br> 

<br><hr><br>
※イメージ写真の商品はセットではありません。<br>
<br>
※実際のお色と多少異なる事があります。<br>
<br>
区分：バラエティ<br><br>
パール金属　佐藤商会<br><br>


<hr>広告文責：株式会社モリキ<br>電話：0269-38-0611<br><style type="text/css">
